parameters.inputSchema:
{
  "type": "object",
  "properties": {
    "Total Work Experience": {
      "type": "string",
      "description": "Total years/months of professional experience",
      "default": "Not mentioned"
    },
    "Current CTC": {
      "type": "string",
      "description": "Current annual cost to company",
      "default": "Not mentioned"
    },
    "Expected CTC": {
      "type": "string",
      "description": "Expected annual cost to company",
      "default": "Not mentioned"
    },
    "Current Notice Period": {
      "type": "string",
      "description": "Notice period duration",
      "default": "Not mentioned"
    },
    "Is Notice Period Negotiable": {
      "type": "string",
      "enum": ["Yes", "No", "Not mentioned"],
      "default": "Not mentioned"
    },
    "Current Place of Residence": {
      "type": "string",
      "default": "Not mentioned"
    },
    "Open for Work from Office": {
      "type": "string",
      "enum": ["Yes", "No", "Not mentioned"],
      "default": "Not mentioned"
    },
    "Any Questions to Get Back": {
      "type": "string",
      "enum": ["Yes", "No"],
      "default": "No"
    },
    "All Information Collected": {
      "type": "string",
      "enum": ["Yes", "No"],
      "default": "No"
    },
    "Need a Call Back": {
      "type": "string",
      "enum": ["Yes", "No"],
      "default": "Yes"
    },
    "Callback Time": {
      "type": "string",
      "description": "When the user prefers a callback",
      "default": "Not specified by the user"
    },
    "Reason for Not able to collect Info": {
      "type": "string",
      "description": "Why information is not collected",
      "default": "Not able to identify"
    }
  },
  "required": [
    "Total Work Experience",
    "Current CTC",
    "Expected CTC",
    "Current Notice Period",
    "Is Notice Period Negotiable",
    "Current Place of Residence",
    "Open for Work from Office",
    "Any Questions to Get Back",
    "All Information Collected",
    "Need a Call Back",
    "Callback Time",
    "Reason for not able to collect Info"
  ]
}
